// We can specify on which stream and how to order our packets, checkout our book and documentation for more information
let unreliable_sequenced = Packet::unreliable_sequenced(destination, bytes, Some(1));
let reliable_sequenced = Packet::reliable_sequenced(destination, bytes, Some(2));
let reliable_ordered = Packet::reliable_ordered(destination, bytes, Some(3)); Take notice of the last Option parameter, with this parameter you can specify which streams to order your packets on. One thing that is important to understand is that 'sequenced streams' are different from 'ordered streams', thus specifying Some(1) for a sequence stream and Some(1) for an ordered stream will be arranged separately from one another. You can use 254 different ordering or sequencing streams, in reality you'd probably only need a few. When specifying None , stream '255' will be used.
